import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { CardBasic } from "../Components/CardBasic";
import { apaksa } from "../Components/apaksa";
import background from "../Restes_bildes/balts.png";

export const Floor = () => {
  const param = useParams();
  const { id } = param;
  useEffect(() => {
    // api call
    console.log("also i call something to python");
    console.log(id);
  }, [id]);

  return <>
  <div>Floor {id}</div>
    <CardBasic>
       <img style={{ position: "absolute", left: 325,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo1" />
       <img style={{ position: "absolute", left: 425,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo2" />
       <img style={{ position: "absolute", left: 525,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo3" />
       <img style={{ position: "absolute", left: 625,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo4" />
       <img style={{ position: "absolute", left: 725,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo5" />
       <img style={{ position: "absolute", left: 825,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo6" />
       <img style={{ position: "absolute", left: 925,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo7" />
       <img style={{ position: "absolute", left: 1025,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo8" />
       <img style={{ position: "absolute", left: 1125,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo9" />
       <img style={{ position: "absolute", left: 1225,top:450, transform: 'scale(0.7)'}} src={background} alt="Logo10" />


    </CardBasic>

</>
};
